import "./styles.css";

import Email from "./components/Email";
import Row from "./components/Row";
import Cell from "./components/Cell";
import Grid from "./components/Grid";
import Typography from "./components/Typography";

export default function App() {
	return (
		<div className="App">
			<Email>
				<Grid>
					<Row>
						<Cell>
              <Typography>
                <h1>Hello World</h1>
              </Typography>
						</Cell>
						<Cell>
							<h1>World</h1>
						</Cell>
					</Row>
					<Row>
						<Cell>
							<h4>Hello</h4>
						</Cell>
						<Cell>
							<h3>World</h3>
						</Cell>
					</Row>
				</Grid>
			</Email>
		</div>
	);
}
